    <script src="https://unpkg.com/axios/dist/axios.min.js"></script>

    <script>
        const app = new Vue({
            el: '#app',
            data: {},
            computed: {},
            watch: {},
            async mounted() {
                await this.activation()
            },
            methods: {
                async activation() {
                    const url = new URL(window.location.href);
                    try {
                        let response = await axios.get("<?= config(HOTBOT_API_URL) ?>v1/users/activateGuestEmail", {
                            params: {
                                token: url.searchParams.get('token')
                            }
                        });
                        if (response.status === 200) {
                            document.location.href = `/activate-android?email=${response.data.response.data.email}&password=${response.data.response.data.password}`;
                        } else {
                            this.showError();
                        }
                    } catch (error) {
                        this.showError();
                    }
                },
                showError() {
                    const message = document.getElementById('message')
                    message.innerText = "Activation token is expired or invalid."
                    message.classList.add("danger")
                }
            }
        })
    </script>


